import React, { PureComponent } from "react";
import Breadcrumbs from '@trendmicro/react-breadcrumbs';
import { Button, ButtonGroup } from '@trendmicro/react-buttons';
import Dropdown, { MenuItem } from '@trendmicro/react-dropdown';
import SideNav, { NavItem, NavIcon, NavText } from '@trendmicro/react-sidenav';
import "@trendmicro/react-sidenav/dist/react-sidenav.css";
import ensureArray from 'ensure-array';
import styled from 'styled-components';

const Main = styled.main`
    position:relative;
    overflow:hidden;
    transition:all .15s;
    padding 0 20px;
    margin-left: ${props => (props.expanded ? 240 : 64)}px;`;


export default class Navigator extends PureComponent {

    state = {
        selected: 'home',
        expanded: false,
    };

    onSelect = (selected) => {
        this.setState({ selected: selected });
    };
    onToggle = (expanded) => {
        this.state({ expanded: expanded })
    }

    navigate = (pathname) => () => {
        this.setState({ selected: pathname });
    };

    page = {
        'home': ['Home'],
        'rentals/listings': ['Rentals', 'Listings'],
        'rentals/userlistings': ['Rentals', 'Userlistings'],
        'info/faq': ['Info', 'faq'],
        'info/tnq': ['Info', 'tnq'],

    }

    renderBreadcrumbs() {
        const { selected } = this.state;
        const list = ensureArray(this.page[selected]);
        return (
            <Breadcrumbs>
                {list.map((item, index) => (
                    <Breadcrumbs.Item active={index === list.length - 1}
                        key={`${selected}_${index}`}
                    >
                        {item}
                    </Breadcrumbs.Item>
                ))}
            </Breadcrumbs>
        );
    }

    navigate = (pathname) => () => {
        this.setState({ selected: pathname });
    };

    render() {
        const { expanded, selected } = this.state;
        return (
            <div>
                <div>
                    <ButtonGroup>
                        <Button btnStyle="flat" onClick={this.navigate('home')}> Home </Button>
                        <Dropdown>
                            <Dropdown.Toggle>
                                Rentals
                        </Dropdown.Toggle>
                            <Dropdown.Menu>
                                <MenuItem onClick={this.navigate('rentals/listings')}>
                                    Listings
                            </MenuItem>
                                < MenuItem onClick={this.navigate('rentals/userlistings')}>
                                    Your Listings
                            </MenuItem>
                            </Dropdown.Menu>
                            <Dropdown.Toggle>
                                Information
                        </Dropdown.Toggle>
                            <Dropdown.Menu>
                                <MenuItem onClick={this.navigate('info/faq')}>
                                    F.A.Q
                            </MenuItem>
                                <MenuItem onClick={this.navigate('info/tnq')}>
                                    Terms And Conditions
                            </MenuItem>
                            </Dropdown.Menu>
                        </Dropdown>
                    </ButtonGroup>
                </div>
                <SideNav onSelect={this.onSelect} onToggle={this.onToggle}>

                    <SideNav.Toggle />
                    <SideNav.Nav selected={selected}>
                        <NavItem eventkey="home">
                            <NavIcon>
                                <i class="fas fa=home" style={{ color: '#F56B75' }} />
                            </NavIcon>
                            <NavText>
                                Home
                    </NavText>
                        </NavItem>
                        <NavItem eventkey="rentals/listings">
                            <NavIcon>
                                <i class="fa fa-list" style={{ color: '#F56B75' }} />
                            </NavIcon>
                            <NavText>
                                Listings
                    </NavText>
                        </NavItem>
                        <NavItem eventkey="rentals/yourlistings">
                            <NavIcon>
                                <i class="fa fa-list" style={{ color: '#F56B75' }} />
                            </NavIcon>
                            <NavText>
                                Listings
                    </NavText>
                        </NavItem>

                        <NavItem eventkey="info/faq">
                            <NavIcon>
                                <i class="fa fa-question" style={{ color: '#F56B75' }} />
                            </NavIcon>
                            <NavText>
                                Frequently Asked Questions
                    </NavText>
                        </NavItem>
                        <NavItem eventkey="info/tnc">
                            <NavIcon>
                                <i class="fa fa-clipboard" style={{ color: '#F56B75' }} />
                            </NavIcon>
                            <NavText>
                                Terms And Conditions
                    </NavText>
                        </NavItem>

                    </SideNav.Nav>
                </SideNav>
                <Main expanded={expanded}>
                    {this.renderBreadcrumbs()}
                </Main>
            </div>
        );
    }
}
